import './Menus.css';

function Menus(props) {
    const [count, setCount] = useState(0)
    const incFn = () => {
        setCount(count + 1)
    }
    return (
        <div>
            <h1>Menus</h1>
            {props.data.map((val,index)=>{
                    return <h4 onClick={incFn} key={index}>{val}</h4>
                           
                })}
             {/* <h4>{props.data[0]}</h4>
            <h4>{props.data[1]}</h4>
            <h4>{props.data[2]}</h4>  */}
        </div>
        
       
    )
    
}
export default Menus;
